import React, { useState } from "react";
import { AppBar, Toolbar, Button, Box, Typography, Select, MenuItem, TextField, InputAdornment } from "@mui/material";
import SearchIcon from "@mui/icons-material/Search";
import LocationOnIcon from "@mui/icons-material/LocationOn";
import logo from "./logo1.png"; // Make sure to replace this with the path to your logo

function App() {
  const [jobType, setJobType] = useState("");
  const [location, setLocation] = useState("");
  const [experience, setExperience] = useState("");

  const handleJobTypeChange = (event) => setJobType(event.target.value);
  const handleLocationChange = (event) => setLocation(event.target.value);
  const handleExperienceChange = (event) => setExperience(event.target.value);

  const handleSearch = () => {
    console.log(`Searching for ${jobType} jobs in ${location} with ${experience} experience.`);
  };

  return (
    <>
      {/* Navigation Bar */}
      <AppBar position="static" sx={{ backgroundColor: "#fff", color: "#000" }}>
        <Toolbar sx={{ display: "flex", justifyContent: "space-between" }}>
          {/* Left Side: Logo and Navigation */}
          <Box sx={{ display: "flex", alignItems: "center" }}>
            <img src={logo} alt="Company Logo" style={{ height: "40px", marginRight: "20px" }} />
            <Box sx={{ "& > *": { margin: "0 10px" } }}>
              <Button color="inherit">Jobs</Button>
              <Button color="inherit">Boost</Button>
              <Button color="inherit">Prep</Button>
              <Button color="inherit">Learn</Button>
              <Button color="inherit">Career Advice</Button>
              <Button color="inherit">Certifications</Button>
            </Box>
          </Box>

          {/* Right Side: Auth Buttons */}
          <Box sx={{ "& > *": { margin: "0 10px" } }}>
            <Button variant="outlined" color="primary">Login</Button>
            <Button variant="contained" color="secondary">Register</Button>
            <Button color="inherit">Employers Login</Button>
          </Box>
        </Toolbar>
      </AppBar>

      {/* Search Bar Section */}
      <Box sx={{ backgroundColor: "#5C1D89", padding: "40px 20px", textAlign: "center", color: "#fff" }}>
        <Typography variant="h4" gutterBottom>
          Over 7,00,000+ jobs to explore
        </Typography>

        <Box
          sx={{
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
            gap: "10px",
            backgroundColor: "#fff",
            padding: "10px",
            borderRadius: "30px",
            width: "80%",
            maxWidth: "800px",
            margin: "20px auto",
          }}
        >
          {/* Job Search Input */}
          <TextField
            variant="outlined"
            placeholder="Search by job, company or skills"
            sx={{ width: "35%", backgroundColor: "#fff", borderRadius: "20px" }}
            InputProps={{
              startAdornment: (
                <InputAdornment position="start">
                  <SearchIcon />
                </InputAdornment>
              ),
            }}
          />

          {/* Location Input */}
          <TextField
            variant="outlined"
            placeholder="Location"
            sx={{ width: "25%", backgroundColor: "#fff", borderRadius: "20px" }}
            InputProps={{
              startAdornment: (
                <InputAdornment position="start">
                  <LocationOnIcon />
                </InputAdornment>
              ),
            }}
          />

          {/* Experience Select */}
          <Select
            value={experience}
            onChange={handleExperienceChange}
            displayEmpty
            sx={{ width: "20%", backgroundColor: "#fff", borderRadius: "20px" }}
          >
            <MenuItem value="" disabled>
              Experience
            </MenuItem>
            <MenuItem value="Fresher">Fresher</MenuItem>
            <MenuItem value="1-3 years">1-3 years</MenuItem>
            <MenuItem value="3-5 years">3-5 years</MenuItem>
            <MenuItem value="5+ years">5+ years</MenuItem>
          </Select>

          {/* Search Button */}
          <Button
            variant="contained"
            color="primary"
            onClick={handleSearch}
            sx={{ height: "55px", borderRadius: "30px", backgroundColor: "#6E00C3", color: "#fff" }}
          >
            Search
          </Button>
        </Box>
      </Box>

      {/* Add additional sections here if needed */}
    </>
  );
}

export default App;
